Lista de pedidos pos intervenção:
O povo é analfabeto político mas sabemos que queremos o seguinte:
-intervenção militar com Bolsonaro no poder…
que ele tenha poder para modificar, anular e prender no país os responsáveis por todos golpes e desequilíbrio nos poderes.
-criminalização do comunismo no país;
-plebiscito para escolha e adequação do nosso regime/sistema político… para que a população possa analisar os regimes ideais como por exemplo a monarquia;
-adequação e/ou anulação de emendas… como o retorno da disciplina política a militares anulada na época de José Sarney. -retorno e implantação do moral e cívica e amor à pátria removido das escolas;
-reverter e anular todas as decisões de parlamentares e ministério recentes e absurdas

